import React from 'react';
import './App.css';
import Header from './components/Header';
import HomepageImage from './components/HomepageImage';

function App() {
  return (
    <div className="App">
      <Header/>
      <header className="App-header">

        <HomepageImage />
        <p>
          My website
        </p>

          Charlie Leopard


      </header>
    </div>
  );
}

export default App;
